import React, { Component } from 'react';
import './App.css';

import 'bootstrap/dist/css/bootstrap.css'
import '@fortawesome/fontawesome-free/css/all.css'

import Navbar from './components/NavBar/Navbar'
import Card from './components/Card/Card'
import LeftNav from './components/LeftNav/LeftNav';
import CardWithChart from './components/Card/ChartWithChart'
import CardWithChartBar from './components/Card/ChartWithChartBar'
import QuickView from './components/QuickView/QuickView'

import { Toast, ToastBody, ToastHeader } from 'reactstrap';

export default class App extends Component {

  state = { users: [] }

  componentDidMount() {
    fetch('/api/users')
      .then(res => res.json())
      .then(users => this.setState({ users }));
  }

  render() {
    return (
      <div className="App">
        <Navbar/>
        <div class="main-data">
          <LeftNav></LeftNav>
          <div className="container-fluid">
            <div className="row">
              <Card className="" headerText="Users" bodyText=
                {this.state.users.map(user =>
                  <div key={user.id}>{user.username}</div>
                )}
              />
            </div>
            <div className="p-3 my-2 rounded">
        <Toast>
          <ToastHeader>
            Reactstrap
          </ToastHeader>
          <ToastBody>
            This is a toast on a white background — check it out!
          </ToastBody>
        </Toast>
      </div>
            <QuickView></QuickView>
            <div className="row">
              <CardWithChartBar headerText="Graf Słupkowy"></CardWithChartBar>
              <CardWithChart headerText="Liczba zapytań"></CardWithChart>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
